import React from 'react'

import './Bookmarks.scss'

const Bookmarks = () => {
  return (
    <div className='bookmarks'>
        <div className="bookmarks__header">
        <h1>Мои закладки</h1>
      </div>
    </div>
  )
}

export default Bookmarks
